import React from 'react';
import './styles.css';

import { MdArrowBack } from 'react-icons/md';

import world from '../../assets/images/world.png';
import twitter from '../../assets/images/twitter.png';
import worldwide from '../../assets/images/worldwide.png';
import company from '../../assets/images/company.png';

export interface Profile {
  name: string;
  login: string;
  bio: string;
  company: string;
  twitter_username: string;
  blog: string;
  location: string;
  public_repos: number;
  followers: number;
  url: string;
  avatar_url: string;
}

interface ProfileProps {
  profile: Profile;
}

const GitHubProfile: React.FC<ProfileProps> = ({ profile }) => {
  return (
    <div className="profile-item">

      <div className="profile-back">
        <MdArrowBack />
      </div>

      <div className="profile-top">

        <img src={profile.avatar_url} alt="" />
        <div className="profile-top-info">

          <h2>{profile.name}</h2>
          <h3>@{profile.login}</h3>
          <p>
            {profile.bio}
          </p>

        </div>

      </div>
      <div className="profile-bottom">

        <div className="profile-info-block">
          <div className="profile-primary-info">
            <p>{profile.public_repos} repositórios</p> 
          </div>

          <div className="profile-primary-info">
            <p>{profile.followers} seguidores</p>
          </div>
        </div>

        <div className="profile-info-block">
          <div className="profile-secondary-info">
            <img src={company} alt=""/>
          </div>
          <div className="profile-secondary-info">
            <img src={twitter} alt=""/> 
          </div>
        </div>

        <div className="profile-info-block">
          <div className="profile-primary-info">
            <p>{profile.public_repos} repositórios</p> 
          </div>

          <div className="profile-primary-info">
            <p>{profile.followers} seguidores</p>
          </div>
        </div>

      </div>
    </div>
  )
}

export default GitHubProfile;
